import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

import Home from './components/Home';

import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
    children: [
      {
        path: '/',
        element: <Home />
      },
    ]
  }
])

function App() {
  return (
    <div className="App">
      <h1>React Router DOM</h1>
      <RouterProvider router={router} />
    </div>
  )
}

export default App;
